import React from 'react';
import './navBar.css';

function NavigationBar() {
    return (
        <nav className="navigation-bar">
            <div className="logo">
                <a href="/">HeartViz</a>
            </div>
            <ul className="nav-links">
                <li><a href="/services">??</a></li>
                <li><a href="/contact">More</a></li>
            </ul>
        </nav>
    );
}

export default NavigationBar;
